import React, { useState,useEffect } from 'react';
import ReactDOM from 'react-dom';
import { Link,useHistory,withRouter } from 'react-router-dom';
import {connect} from "react-redux"

function Navbar(props) { 

  let history = useHistory();
  let searchString;
  const [serachinput, setserachinput] = useState({});

  let [loginstatus, setLoginStatus] = useState(props.logedin);
  useEffect(() => {
      setLoginStatus(props.logedin);
  }, [props.logedin])

 var  logout = ()=>{
    props.dispatch({
      type:"LOGOUT"
    })
    history.push("/Login")
 }

    let search = (event)=>{

      event.preventDefault()
     if(serachinput!='') {
        var url = "/search?q="+ serachinput
        props.history.push(url)
     }
  }

  let getSearchText = function(event){
       const searchString = event.target.value
       setserachinput(searchString)
  }
  //console.log(props.cart.length)

  return (
    <div>
      <div className="container-fluid" style={{marginTop:'50px',marginBottom:'20px'}}>
      <div className="row">
      <div className="col-sm-4">
      <Link to="/" style={{textDecoration:'none',color:'black'}}>  <h2> Cake Shop {props.cart.length} </h2> </Link>
       </div> 
       <div className="col-sm-4">
       <form className="d-flex">
        <input onChange={getSearchText} className="form-control form-control-lg" type="search" placeholder="Search" aria-label=".form-control-lg example" />
        <button onClick={search} className="btn btn-outline-success" type="submit">Search</button>
      </form>
       </div> 
       <div className="col-sm-4">

        <h5 style={{float:'right'}}>
        <i className="fa fa-shopping-cart" aria-hidden="true"></i>
        {!props.isloggedin ? (
      <span style={{marginRight:"10px"}}>  0 items in cart </span> ) : 
      (<span style={{marginRight:"10px"}}> <Link to="/Cart" style={{textDecoration:'none',color:'black'}}> {props.cart} items in cart </Link>  </span>) }

          <i className="fa fa-user" aria-hidden="true" style={{marginRight:'10px'}}></i>
        {!props.isloggedin ? 
 <Link to="/Login" style={{textDecoration:'none',color:'black'}}> Login  </Link>  :


 <span style={{textDecoration:'none',color:'black',cursor:'pointer'}} onClick={logout}> Logout  </span>  }

 {!props.isloggedin ?(

 <Link to="/Signup" style={{textDecoration:'none',color:'black'}}> Register  </Link> ):("") } </h5>

       </div> 
      </div>
      </div>
      <hr />
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
  <div className="container">
    <a className="navbar-brand" href="#">Precription</a>
    <a className="navbar-brand" href="#"><i className="fa fa-heart" aria-hidden="true" style={{color:'black'}}></i>Blog</a>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent" style={{marginLeft:'50px'}}>
      <ul className="navbar-nav me-auto mb-2 mb-lg-0" style={{fontWeight:'bold'}}> 
        <li className="nav-item">
          <a className="nav-link" aria-current="page" href="#"><i className="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Motprot</a>
        </li>
        <li className="nav-item" style={{marginLeft:'20px'}}>
          <a className="nav-link" href="#"><i className="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Coffee For Many</a>
        </li>
        <li className="nav-item" style={{marginLeft:'20px'}}>
          <a className="nav-link" href="#"><i className="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Easy To Make </a>
        </li>
        <li className="nav-item" style={{marginLeft:'20px'}}> 
          <a className="nav-link" href="#"><i className="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Breakfast </a>
        </li>
      </ul>
      <button className="btn btn-success btn-lg"> CREATE <i className="fa fa-plus" aria-hidden="true" style={{marginRight:'5px'}}></i></button>
    </div>
  </div>
</nav>
    </div>
  );
}

Navbar =  connect((state,props)=>{
 // alert(JSON.stringify(state.CartReducer?.cart))
  return {
    projectname:state.AuthReducer?.username,
    isloggedin:state.AuthReducer?.isloggedin,
    cart: state.CartReducer?.cart
  }
})(Navbar) 

export default withRouter(Navbar)
